import React, { Component } from 'react';
import Header from './Header';
import Header2 from './Header2';
import MainContent from './MainContent';

import '../css/mainPage.css';

class YounghoSearchResultPage extends Component {
    constructor(props) {
        super(props);
        this.state={
          userId:"alice"
        }
    }

    render() {
        const {userId} = this.props;
        // if(auth == false) {
        //     this.props.history.push("/login");
        // }

        return (
            <>
            <Header2 userId={this.state.userId} {...this.props}></Header2>
            <MainContent userId={this.state.userId} {...this.props}></MainContent>
            </>
        );
    }
}
export default YounghoSearchResultPage;
